  input: TEXT,F3XA,,"1)  As noted on the Mid-Year report, the committee made a transfer
    on June 18, 2001 which represented a good faith estimate of the federal portion
    of non-federal in-kind contributions received, based upon the estimated value
    of the in-kinds received multiplied by the estimated federal portion of the funds
    received ratio.  The transfer of $6,216.36 reflected an adjustment of that estimate.  Since
    this committee was formed for one event, there are no other 'current' procedures
    to speak of.  2) Schedules H2, H3 and H4 have been amended to reflect that the
    event date was 6/18/02.  3)  This committee was a joint fundraising committee
    that was formed by three federal politicial committees for the sole purpose of
    administering a joint fundraising event.  It did not have any overhead expenditures."
